  const [Item, setItem] = useState("");
  const [newItem, setnewItem] = useState("");

  const ItEvent = (e) => {
    setItem(e.target.value);
  };
  return (
    <>
      <div className="main_div">
        <div className="center_div">
          <br />
          <h1>TODO List</h1>
          <br />
          <input type="text" placeholder="Add an Item" onChange={ItEvent} />
          <Button className="newBtn" on>
            <AddIcon />
          </Button>
          <br />
          <ol>
            <li>{Item}</li>
          </ol>
          <br />
        </div>
      </div>
    </>
  );
};

export default ToDoList;
